import React from "react";
import { Container, Name, Price, Bowl } from "./FoodElements";

const Food = ({ id, img, name, price, bowl }) => {
  const imgStyle = {
    borderRadius: "50%",
    // transform: "translatey(-34px)",
    margin: "-24px",
  };
  return (
    <Container key={id}>
      <img src={img} alt={name} width="132px" height="132px" style={imgStyle} />
      <Name>{name}</Name>
      <Price>${price}</Price>
      <Bowl>{bowl} Bowls available</Bowl>
    </Container>
  );
};

export default Food;
